def _get_time_bins(self, ax):
    import pandas as pd
    from pandas.tseries.frequencies import to_offset

    if not isinstance(ax, pd.DatetimeIndex):
        raise TypeError(
            "axis must be a DatetimeIndex, but got "
            f"an instance of {type(ax).__name__}"
        )

    if len(ax) == 0:
        binner = labels = pd.DatetimeIndex(data=[], freq=self.freq, name=ax.name)
        return binner, [], labels

    first = ax.min().floor(self.freq)
    last = ax.max().ceil(self.freq)

    offset = to_offset(self.freq)
    closed = self.closed if self.closed in ('left', 'right') else 'left'

    bins = pd.date_range(start=first, end=last, freq=self.freq, tz=ax.tz, name=ax.name, closed=closed, ambiguous='infer', normalize=offset.normalize)

    if self.closed == "right":
        labels = bins
        if self.label == "right":
            labels = labels[1:]
    elif self.label == "right":
        labels = labels[1:]

    if ax.hasnans:
        binner = bins.insert(0, pd.NaT)
        labels = labels.insert(0, pd.NaT)

    if len(bins) < len(labels):
        labels = labels[: len(bins)]

    return bins, bins, labels
